import './css/App.css';

function CarVans(data) {
    console.log(data);
    return (
        <div className='card'>
            <div className='card-image'>
                <img src={require("./css/image/vans1.png")} alt="image" />
            </div>
            <div className='card-content'>
                <h2>{data.title}</h2>
                <div>
                    <span className="price"><strong>$60</strong></span>
                    <span className="unit"> <br /> /day</span>
                </div>
                <button>Simple</button>
            </div>
        </div>
    )

}

export default CarVans
